import React from 'react'
import  ButtonCSS from "./Btn.module.css";

interface ButtonProps {
  buttonText: string;
}

const Btn:React.FC<ButtonProps> = ({buttonText}) => {
  return (
    <div>
        <button className={ButtonCSS.btn}>{buttonText}</button>
    </div>
  )
}

export default Btn
